import React from 'react'
import Navbar from '../../components/navbar/Navbar'
import postdata from "./postdata"
import "./Homepage.css"


function Homepage() {
  return (
    <div className='homepage'>

      <Navbar />

      <h2>Homepage</h2>

      {postdata.map((data, index) => (
        <Post
          key={index}
          username={data.username}
          date={data.date}
          text={data.text}
        />
      ))}
    </div>
  )
}

export default Homepage
